import React from "react";
import { Box, Hero, Container, Row } from "../../styles/common";
import { ThemeProvider } from "../../styles/theme";
import { StyledTestimonialsContainer, StyledTestimonialsHero } from "./styles";

const TestimonialsList = ({ setSlide, testimonials }) => {
  return (
    <ThemeProvider>
      <StyledTestimonialsHero>
        <StyledTestimonialsContainer>
          <Row>
            {testimonials.map((testimonial, index) => {
              return (
                <Box
                  columns={3}
                  key={testimonial.person}
                  onClick={() => setSlide(index)}
                >
                  {testimonial.review}
                </Box>
              );
            })}
          </Row>
        </StyledTestimonialsContainer>
      </StyledTestimonialsHero>
    </ThemeProvider>
  );
};
export default TestimonialsList;
